text:
LE PRESIDENT DE LA REPUBLIQUE,
Vu la Constitution ;
Vu la loi n°82/14 du 26 Novembre 1982 fixant l'organisation et le fonctionnement du Conseil Supérieur de la Magistrature, modifiée par celle n° 89/16 du 28 Juillet 1989 ;
DECIDE:
Art. 1er —  Une réunion du Conseil Supérieur de la Magistrature est convoquée et se tiendra à la Salle des Conseils de la Présidence de la République, Palais de l'Unité, le jeudi 18 décembre 2014 à partir de 10 heures.
Art. 2 —  La présente décision sera enregistrée et publiée au Journal Officiel en français et en anglais.
